import '../../css/Shared/section.css'
import '../../css/Social/friendSection.css'
const FriendSection = (props) => {
    return (
    <div>
        <div>
            <h2>Friends</h2>
            <FriendBar></FriendBar>
        </div>

        <FriendScroll></FriendScroll>
    </div>
    )
}

export default FriendSection;
